import React from 'react'
import { SafeAreaView, View, Text, StyleSheet } from 'react-native'

export default function HomeScreen({ navigation }) {
    return(
            <View>
                <Text>Home</Text>
            </View>
    )
}

const styles = StyleSheet.create({
    container:{
        flex: 1,
        backgroundColor: '#222831',
        paddingTop: 36,
        paddingStart: 14,
        paddingEnd: 14,
    }
})
